import React from 'react'
//import styles from './App.module.scss'
import './TodoListHeader.scss'

class TodoListHeader extends React.Component {

    constructor(props) {
        super(props);
    }

    render() {
        return (

            <div className="container header">
                <div className="row h-100">
                    <div className="col-md-10 text-center border">
                        <h4 className="">{this.props.project.id}: {this.props.project.name}</h4>
                    </div>
                    <div className="col-md-1 text-center border">
                        <button type="button" className="btn btn-warning">E</button>
                    </div>
                    <div className="col-md-1 text-center border">           
                        <button type="button" className="btn btn-danger">D</button>
                    </div>
                </div>
            </div>

        )
    }
}

export default TodoListHeader
